import React from 'react'
import Clock from 'react-live-clock';

function Time() {
    return (
        <div>
            <Clock format={'dddd, MMMM Mo, YYYY, h:mm:ss A '} ticking={true} timezoom="US"/> 
        </div>
    )
}

export default Time;
